import React, { useEffect } from 'react';
import { useSelector, useDispatch } from "react-redux";
import { withCookies } from "react-cookie";
import { Link } from 'react-router-dom';
import { pdfjs, Document, Page } from "react-pdf";
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;

import {
    selectPDF_list,
    fetchAsyncPDFGet,
} from "./reportSlice";
import Search_bar from './Search_bar';

const Report = (props) => {
    const dispatch = useDispatch();
    const token = props.cookies.get("current-token");
    const pdf_list = useSelector(selectPDF_list);

    useEffect(() => {
        dispatch(fetchAsyncPDFGet(token))
    }, [dispatch]);

    const take_url_name = (number) => {
        let dir = window.location.href.split("/");
        let dir2 = dir[dir.length - number];
        return dir2;
    }

    const target_company = pdf_list.filter((output) => {
        return output.company_number == take_url_name(2)
    })

    return (
        <div>
            <div>
                <Search_bar pdf_list={pdf_list}/>
            </div>
            <div>
                {pdf_list.map((pdf) => (
                    <Link key={pdf.id} to={`/report/${pdf.company_number}/`} style={{ textDecoration: 'none', color: '#424242' }}>
                        {pdf.company_name} {pdf.company_number} 
                    </Link>
                ))}
            </div>
                {target_company.map((each_pdf) => (
                    <div>
                        {each_pdf.regist_date.slice(0, 10)}{each_pdf.pdf_title}
                        <Document
                            file={{
                            url: "http://localhost:8000/media/pdf/whitepaper4484%E3%83%A9%E3%83%B3%E3%82%B5%E3%83%BC%E3%82%B9_jpyCvTl.pdf"
                            }}
                        />
                    </div>
                ))}
            <div>

            </div>
        </div>
    )
}

export default withCookies(Report)
